Translation: Josh decides to sell his house. He buys the house for $80,000 and invests $50,000 in renovations. This increases the house's value by 150%. How much profit did he make?

To calculate the profit, we first find the total cost including renovations, which is $80,000 + $50,000 = $130,000. The house's value increased by 150%, so the increase in value is 150% of $130,000, which is 1.5 * $130,000 = $195,000. Therefore, the selling price of the house is $130,000 + $195,000 = $325,000. The profit is the selling price minus the total cost, which is $325,000 - $130,000 = $195,000.

The profit Josh made is $\\boxed{195000}
